import React from 'react';
import './CubeLoader.css'; // Asegúrate de tener un archivo CubeLoader.css

const CubeLoader = () => {
  return (
    <div className="cube-loader">
      <div className="cube-wrapper">
        {[...Array(6)].map((_, i) => (
          <div key={i} className="cube-span" style={{ '--i': i }}>
          </div>
        ))}
      </div>
      <div className="cube-top"></div>
    </div>
  );
};

export default CubeLoader;
